import React from "react";

export const Pagination = ({ page, setpage, len }) => {
  const arr = [...Array(3)];
  console.log(arr);
  return (
    <div className="pagination">
      <button
        onClick={() => {
          if (page > 1) setpage((prev) => prev - 1);
        }}
        disabled={page}
      >
        PREV
      </button>

      <span>
        {[...Array(3)].map((_, i) => {
          return (
            <button
              className={page == i + 1 ? "active" : ""}
              onClick={() => setpage(i + 1)}
            >
              {i + 1}
            </button>
          );
        })}
      </span>
      <button
        onClick={() => {
          if (page < len) setpage((prev) => prev + 1);
        }}
      >
        NEXT
      </button>
    </div>
  );
};
